import React from 'react';
import './TelegramCards.css';

const TelegramCards = () => {
    return (
        <div className="telegram-cards-container">
            <div className="card left">
                <h2>Ismga Rasm</h2>
                <img src="https://via.placeholder.com/150" alt="Ismga rasm" />
                <button className="button">Yuklab olish</button>
            </div>
            <div className="card right">
                <h2>Ismga Video</h2>
                <video width="150" controls>
                    <source src="https://www.w3schools.com/html/mov_bbb.mp4" type="video/mp4" />
                    Brauzeringiz video formatini qo‘llab-quvvatlamaydi.
                </video>
                <button className="button">Yuklab olish</button>
            </div>
            <div className="card left">
                <h2>Ismga Rington</h2>
                <audio controls>
                    <source src="https://www.w3schools.com/html/horse.mp3" type="audio/mp3" />
                    Brauzeringiz audio formatini qo‘llab-quvvatlamaydi.
                </audio>
                <button className="button">Yuklab olish</button>
            </div>
        </div>
    );
};

export default TelegramCards;
